using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.Logging;
using PixelGift.Core.Entities;
using PixelGift.Core.Entities.Identity;
using PixelGift.Core.Extensions;

namespace PixelGift.Infrastructure.Data;

public class PixelGiftContextSeed
{
    private const string Fortnite = "fortnite";
    private const string Valorant = "valorant";
    private const string LeagueOfLegends = "league of legends";
    private const string CounterStrike = "cs2";

    private const string Based64Image = "";

    public static async Task SeedAsync(PixelGiftContext context, ILoggerFactory loggerFactory)
    {
        var logger = loggerFactory.CreateLogger<PixelGiftContextSeed>();

        try
        {
            await SeedUsers(context, logger);

            await SeedCategories(context, logger);

            await SeedPromoCodes(context, logger);

            await context.SaveChangesAsync();

        }
        catch (Exception ex)
        {
            logger.LogError(ex.Message);
        }
    }

    private static async Task SeedPromoCodes(PixelGiftContext context, ILogger<PixelGiftContextSeed> logger)
    {
        logger.LogInformation("Remove old Promo Codes");
        context.PromoCodes.RemoveRange(context.PromoCodes);

        var promoCodes = new[]
        {
            new PromoCode{Code = "GigaCode", Expiry = DateTime.Now.AddDays(15)},
            new PromoCode{Code = "TRUSHIM00n", Expiry = DateTime.Now.AddDays(-25)},
            new PromoCode{Code = "SMART_ME", Expiry = DateTime.Now.AddDays(3)},
        };

        logger.LogInformation("Creating new Promo Codes seed");
        await context.PromoCodes.AddRangeAsync(promoCodes);
    }

    private static async Task SeedUsers(PixelGiftContext context, ILogger<PixelGiftContextSeed> logger)
    {
        logger.LogInformation("Remove old Users seed");
        context.Users.RemoveRange(context.Users);

        var users = new[]
        {
            new User{ Username = "admin", Role = UserRole.Admin, HashedPassword = "Pa$$Word".ToSha256Hash() }
        };

        logger.LogInformation("Creating new Users seed");
        await context.Users.AddRangeAsync(users);
    }

    private static async Task SeedCategories(PixelGiftContext context, ILogger logger)
    {
        logger.LogInformation("Remove old Categories seed");
        context.Categories.RemoveRange(context.Categories);

        var categories = new[]
        {
                new Category { Name = Fortnite },
                new Category { Name = Valorant },
                new Category { Name = LeagueOfLegends },
                new Category { Name = CounterStrike },
        };

        logger.LogInformation("Creating new Categories seed");
        await context.Categories.AddRangeAsync(categories);

        var category = categories.First(c => c.Name == LeagueOfLegends);

        logger.LogInformation("Creating items seed for: {category}", category.Name);
        SeedItems(category);

        logger.LogInformation("Creating form fields seed for: {category}", category.Name);
        SeedFormFields(category);
    }

    private static void SeedItems(Category category)
    {
        var items = new[]
        {
                new Item
                {
                    Name = "Hextech Key",
                    Base64Image = Based64Image,
                    PolishName = "Polish Hextech Key",
                    Quantity = 10,
                    UnitPrice = 50.0m,
                },
                new Item
                {
                    Name = "Hextech Chest",
                    Base64Image = Based64Image,
                    PolishName = "Polish Hextech Chest",
                    Quantity = 5,
                    UnitPrice = 75.0m,
                },
                new Item
                {
                    Name = "Skin 1",
                    Base64Image = Based64Image,
                    PolishName = "Polish Skin 1",
                    Quantity = 20,
                    UnitPrice = 100.0m,
                },
                new Item
                {
                    Name = "Skin 2",
                    Base64Image = Based64Image,
                    PolishName = "Polish Skin 2",
                    Quantity = 15,
                    UnitPrice = 120.0m,
                },
                new Item
                {
                    Name = "Champion Shard",
                    Base64Image = Based64Image,
                    PolishName = "Polish Champion Shard",
                    Quantity = 8,
                    UnitPrice = 90.0m,
                },
                new Item
                {
                    Name = "Ward Skin",
                    Base64Image = Based64Image,
                    PolishName = "Polish Ward Skin",
                    Quantity = 25,
                    UnitPrice = 60.0m,
                },
                new Item
                {
                    Name = "Emote",
                    Base64Image = Based64Image,
                    PolishName = "Polish Emote",
                    Quantity = 12,
                    UnitPrice = 0.21m,
                },
                new Item
                {
                    Name = "Summoner Icon",
                    Base64Image = Based64Image,
                    PolishName = "Polish Summoner Icon",
                    Quantity = 18,
                    UnitPrice = 1.66m,
                }
            };

        foreach (var item in items)
        {
            category.Items.Add(item);
        }
    }

    private static void SeedFormFields(Category category)
    {
        var formFields = new FormField[]
        {
            new FormField
            {
                Name = "region",
                Type = FieldType.Select,
                Options = "EUNE, EUW, NA"
            },
            new FormField
            {
                Name = "summoner name",
                Type = FieldType.Input,
            },
            new FormField
            {
                Name = "email address",
                Type = FieldType.Input
            }
        };

        foreach (var formField in formFields)
        {
            category.FormFields.Add(formField);
        }
    }
}

